import React, { Component } from 'react';

class ApprovedSummaryContainer extends Component {

    render() {
        return (
            <div className='approved-heading'>
                <p className='approved-text'>{thankYouText} <span className='approved-amount'>{loanAmount}</span> {upTo} {loanTerm}</p>
                
                <div className='approved-more-section'>
                </div>
            </div>
        )
    }
  }
  
  export default ApprovedSummaryContainer;
